import React from 'react';

function HomePageMockup() {
  const colors = {
    background: '#121212',    // Dark charcoal
    gold: '#b68b2f',          // Gold/bronze accent
    cream: '#f2f0e6',         // Soft off-white text
    brown: '#6f4f2e'          // Warm brown
  };

  return (
    <div 
      style={{ 
        backgroundColor: colors.background, 
        color: colors.cream, 
        minHeight: '100vh', 
        fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
        padding: '2rem'
      }}
    >
      {/* Header with logo */}
      <header style={{ textAlign: 'center', marginBottom: '2rem' }}>
        <div
        style={{
            backgroundColor: '#b68b2f',
            padding: '8px',
            borderRadius: '8px',
            display: 'inline-block',}}>
            <img
                src={matchup.leagueLogo}
                alt="League Logo"
                style={{
                    height: '80px',
                    width: 'auto',
                    objectFit: 'contain',
                    display: 'block',
                    margin: '0 auto',
                    filter: 'brightness(1.1) contrast(1.2)',
                }}
            />
        </div>
        <h1 style={{ color: colors.gold, fontSize: '2.5rem', fontWeight: 'bold', letterSpacing: '0.1em' }}>
          League of Ordinary Gentlemen
        </h1>
      </header>

      {/* Ribbon */}
      <div 
        style={{ 
          backgroundColor: colors.gold, 
          color: colors.background, 
          padding: '0.75rem 1.5rem', 
          borderRadius: '30px', 
          width: 'fit-content', 
          margin: '0 auto 3rem auto',
          fontWeight: '600',
          letterSpacing: '0.1em',
          textTransform: 'uppercase',
          boxShadow: `0 0 15px ${colors.gold}`
        }}
      >
        Week 1 Matchup
      </div>

      {/* Matchup info */}
      <section style={{ maxWidth: '600px', margin: '0 auto' }}>
        <div style={{ marginBottom: '1.25rem' }}>
          <strong style={{ color: colors.gold, fontSize: '1.25rem' }}>TuckE71:</strong> 0
        </div>
        <div style={{ marginBottom: '1.25rem' }}>
          <strong style={{ color: colors.gold, fontSize: '1.25rem' }}>petehadley1712:</strong> 0
        </div>
        <div style={{ fontSize: '1.25rem', textAlign: 'center', fontWeight: 'bold' }}>
          Result: <span style={{ color: colors.gold }}>Tied</span>
        </div>
      </section>

      {/* Footer */}
      <footer style={{ textAlign: 'center', marginTop: '4rem', fontSize: '0.875rem', color: colors.brown }}>
        &copy; 2025 League of Ordinary Gentlemen
      </footer>
    </div>
  );
}

export default HomePageMockup;
